import React from 'react'
import { Link } from 'react-router-dom'
import ContactItem from '../../ContactItem';
import phone from '../../slider/img/phone.png';
import email from '../../slider/img/email.png';
import telegram from '../../slider/img/telegram.png';

function Contacts() {
    return (
        <div>
        <div className='contact-sect'>
            <ContactItem icon={phone} text={'+996550088181'} text2={'+996550088181'} title={phone}/>
            <ContactItem icon={email} text={'aizhamalkanybekova72@gmail.com'} title={email} />
            <ContactItem icon={telegram} text={'aijamalkanybekova'} title={telegram} />
        </div>
        </div>

     
    )
}

export default Contacts
